urce:"previous scrape",name:"Modern Family House in OudZuid",description:"Perfect for a family or groups, within a short distance from the city centre, the best museums and Amsterdams' premier shopping area. We live in probably the best part of the city: Amsterdam OudZuid. Central, yet safe and tranquil.<br /><br />We prefer families! Or groups who's average age is over 35 yrs old... <br />No students or bachelor parties, sorry about that!<br /><br /><b>The space</b><br />To tell a little bit about our house.  Our house has two floors and measures 175m2. The house dates back to 1926. We bought it 20 years ago and renovated it in a modern way.<br /><br />About the groundfloor (acces to the house, no steps): Entrance and hallway, The living room with Cable TV and Wifi,  adjourned to an open, new and totally equiped kitchen. The groundfloor has recently been refurbished.  The 2,5 meter dinner table, which seats eight people easily, is the heart of the living room . <br /><br />On the first floor you will find the master bedroom and three other bedrooms. On this",neighborhood_overview:"Our neighborhood is pleasant, friendly, not to crowded and a little up market. But it is not boring! There are many, many cafes, restaurants and bars within walking distance. With the city centre at 12 minutes, we tend to think we have it all....",picture_url:"https://a0.muscache.com/pictures/24412011/73f8a123_original.jpg",host_id:8296118,host_url:"https://www.airbnb.com/users/show/8296118",host_name:"Arno",host_since:"8/21/2013",host_location:"Amsterdam, Netherlands",host_about:"We are a Dutch family of five. We have three boys, aged 18, 16 and 13. They all go to school in Amsterdam, they play football at AFC (Amsterdam Football Club) and all three play tennis as well. My wife Marcia is a doctor, a general practitioner. I work in the music industry, I conduct consultancy and music related market research. \n\nWe enjoy living in Amsterdam, especially in our neighbourhood \"Oud-Zuid\" (Old South). Allthough it is known as a slightly posh neighbourhood, there is enough to do. The centre of the city, the Vondelpark, the musea, everything is very close by. Amsterdam is not a very big city. It's liberated, free and has a friendly atmosphere.\n\nI like music very much and hope you will enjoy the grand piano. It's an old Bechstein piano. If you can't play, the piano is also useful to put your glass on. I enjoy the Beatles, Bruce, Led Zeppelin and Status Quo. I'm 51, music preference seems to be burned into ones DNA. The boys are very much into sports, as is Marcia. \n\nWe enjoy travelling and enjoy holidays away from home.",host_response_time:"N/A",host_response_rate:"N/A",host_acceptance_rate:"N/A",host_is_superhost:"f",host_thumbnail_url:"https://a0.muscache.com/im/users/8296118/profile_pic/1377267132/original.jpg?aki_policy=profile_small",host_picture_url:"https://a0.muscache.com/im/users/8296118/profile_pic/1377267132/original.jpg?aki_policy=profile_x_medium",host_neighbourhood:"",host_listings_count:1,host_total_listings_count:1,host_verifications:"['email', 'phone']",host_has_profile_pic:"t",host_identity_verified:"f",neighbourhood:"Amsterdam, North Holland, Netherlands",neighbourhood_cleansed:"Zuid",neighbourhood_group_cleansed:"",latitude:52.3481,longitude:4.85904,property_type:"Entire townhouse",room_type:"Entire home/apt",accommodates:4,bathrooms:"",bathrooms_text:"1 bath",bedrooms:4,beds:5,amenities:["Smoke alarm","Stove","Waterfront","Luggage dropoff allowed","Dishwasher","Oven","Coffee maker","Heating","Patio or balcony","Bed linens","Private entrance","Wifi","Microwave","Washer","Essentials","First aid kit","Carbon monoxide alarm","Paid parking on premises","Extra pillows and blankets","Cooking basics","Dryer","Shampoo","Hair dryer","Hot water","Dishes and silverware","Hangers","Kitchen","Long term stays allowed","Pets allowed","Iron","TV with standard cable","Shower gel","Refrigerator"],price:"$285.00",minimum_nights:2,maximum_nights:1125,m